import React from 'react';
import "./header.css";
import logo from './img/logo.svg';
import mark from './img/nw_selarw.png';
import bag from './img/cart.png';
import user from './img/user.png';






const Header = () => {
  return (
   <header>
          <a href="vk.com"><img src={logo} alt="logo" className='logo' /></a>
    <ul class="menu-main topmenu">         
        <li><form action="#">
 
 <div class="select-box">
   
   <label for="select-box1" class="label select-box1"><span class="label-desc">Choose your country</span> </label>
   <select id="select-box1" class="select">
     <option value="Choice 1">Falkland Islands</option>
     <option value="Choice 2">Germany</option>
     <option value="Choice 3">Neverland</option>
   </select>
   
 </div>
  
</form>         
        </li>
         <li><a href="">F.A.Q</a></li>
         <li><a href="">Контакты</a></li>
         
    </ul>
          <a href="#"><img src={user} alt="" className='userico'/>
          </a>
          <a href="#"><img src={bag} alt="" className='bagico'/>
          </a>
      
   </header>
   
  );
}


export default Header
